$(document).ready(function(){var e;$(".dialog-form").dialog({autoOpen:!1,show:{effect:"blind",duration:500},hide:{effect:"blind",duration:500}}),$(".purchase").click(function(){$(".dialog-form").dialog("open"),e=this.id}),$(".form1").submit(function(t){t.preventDefault(),$.ajax({type:"POST",url:"/yummy_store/items/add_to_cart",data:{item_id:e,item_quantity:$("#OrderQuantity").val()},success:function(e){$(".dialog-form").dialog("close"),e.indexOf("Can")>-1?swal({title:"Error",text:e,icon:"error"}):swal({title:"Success",text:e,icon:"success"})},error:function(){$(".dialog-form").dialog("close"),swal({title:"Error",text:"You must login to purchase item",icon:"error"})}})}),$("#UserUserEmail").change(function(){$.ajax({type:"POST",url:"/yummy_store/users/check_exist",data:{email:$("#UserUserEmail").val()},success:function(e){$("#message").html(e)}})}),$("#UserUserBirthday").datepicker({dateFormat:"yy-mm-dd", defaultDate: "90-12-12",changeMonth: true, changeYear: true}),$("#confirm_pass").change(function(){$pass=$("#new_pass").val(),$confirm=$("#confirm_pass").val(),$pass!=$confirm?$("#match").html("Password confirm doesn't match"):$("#match").html("")}),$(".delete").click(function(){return confirm("Are you sure?")})});